import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js";

function App() {
  return (
    <div>
      <Header />
      notes.map(
      <Note title={notes[1].title} content={notes.content} /> )
      <Footer />
    </div>
  );
}

export default App;
